import React from 'react';
import '../css/home.css'
import axios from 'axios';
import { toast } from 'react-toastify';
import { useNavigate } from 'react-router-dom';
function Home(props) {
    const navigate = useNavigate()
    const check_in = async () => {
        const getToken = localStorage.getItem("token")
        const res = await axios.post('https://ddc.fis.vn/fis0/api/checkin_all', { headers: { "Authorization": `Bearer ${getToken}` } })
        if (res.data.resultCode == -1) {
            toast.warning(res.data.message)
            navigate('/')
        }
        else (
            toast.success(res.data.message)
        )
    }

    const check_out = async () => {
        const getToken = localStorage.getItem("token")
        const res = await axios.post('https://ddc.fis.vn/fis0/api/checkout_all', { headers: { "Authorization": `Bearer ${getToken}`} })
        if (res.data.resultCode == -1) {
            toast.warning(res.data.message)
            // navigate('/')
        }
        else (
            toast.success(res.data.message)
        )
        console.log('ffffff',res.data);
    }
    return (
        <div className='box-check'>
            <div className='d-flex justify-content-between '>
                <button type="button" class="btn btn-info text-white" onClick={() => check_in()}>Chi</button>
                <button type="button" class="btn btn-danger text-white" onClick={() => check_out()}>Chot</button>
            </div>
        </div>
    );
}

export default Home;
